import React from 'react'
import Userinfo from './Userinfo'


const About = () => {
  return (
    <div>
    <h1 >About</h1>
    <div className='about'>
    {/* <Userinfo fname={"Brundaban Tripathy"} /> */}
    <Userinfo mname={"Lata Tripathy"} location={"Koraput"}/>
    </div>
    </div>
  )
}

export default About
